import { Environment } from '../app/models/environment.model';

export const environment: Environment = {
  production: true,
  youtubeConfig: {
    defaultSearchOptions: {
      order: 'viewCount' as const,
      videoDefinition: 'high' as const,
      maxResults: 12,
      regionCode: 'IN',
      relevanceLanguage: 'ml',
      category: 'cinema'
    },
    categories: [
      {
        id: 'cinema',
        name: 'Cinema',
        videoCategoryId: '1',
        searchParams: {
          q: 'malayalam full movie',
          videoDuration: 'long',
          minViewCount: 100000,
          order: 'date',
          category: 'cinema'
        }
      },
      // ... same categories as environment.ts
    ]
  }
};
